    "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider = \"prisma-client\"\n  output   = \"../src/generated\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\nmodel Employer {\n  id   BigInt @id\n  name String\n\n  vacancies Vacancy[]\n}\n\nmodel Vacancy {\n  id                BigInt                   @id\n  name              String\n  description       String?\n  employerId        BigInt?\n  employer          Employer?                @relation(fields: [employerId], references: [id])\n  areaId            BigInt?\n  publishedAt       DateTime?\n  archived          Boolean                  @default(false)\n  url               String?\n  salaryFrom        Decimal?\n  salaryTo          Decimal?\n  currency          String?\n  professionalRoles Json?\n  experience        Json?\n  updatedAt         DateTime?                @updatedAt\n  tsv               Unsupported(\"tsvector\")?\n\n  skills VacancySkill[]\n}\n\nmodel VacancySkill {\n  vacancyId BigInt\n  skillName String\n  vacancy   Vacancy @relation(fields: [vacancyId], references: [id], onDelete: Cascade)\n\n  @@id([vacancyId, skillName])\n}\n\nmodel RawItem {\n  source    String\n  hhId      String // Changed to String to support both vacancy IDs (bigint) and resume IDs (text)\n  payload   Json\n  fetchedAt DateTime @default(now())\n\n  resumes Resume[]\n\n  @@id([source, hhId])\n}\n\nmodel SyncState {\n  source   String    @id\n  lastSeen DateTime?\n  page     Int       @default(0)\n}\n\nmodel User {\n  id            BigInt   @id @default(autoincrement())\n  email         String   @unique\n  password      String\n  role          String   @default(\"user\") // \"user\", \"admin\", \"superadmin\"\n  emailVerified Boolean  @default(false)\n  createdAt     DateTime @default(now())\n  updatedAt     DateTime @updatedAt\n}\n\n// Resume-related models\nmodel ManagerToken {\n  managerId    BigInt   @id\n  accessToken  String\n  refreshToken String?\n  dailyLimit   Int      @default(200)\n  usedToday    Int      @default(0)\n  lastReset    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  resumeAudits ResumeViewAudit[]\n}\n\nmodel Resume {\n  id              String    @id\n  title           String?\n  areaId          Int?\n  areaName        String?\n  experienceYears Int?\n  salaryDesired   Decimal?\n  currency        String?\n  updatedAt       DateTime?\n  rawSource       String // source from raw_item (e.g., \"resume\")\n  rawId           String // hhId from raw_item\n  rawItem         RawItem   @relation(fields: [rawSource, rawId], references: [source, hhId])\n\n  skills     ResumeSkill[]\n  viewAudits ResumeViewAudit[]\n\n  @@unique([rawSource, rawId])\n}\n\nmodel ResumeSkill {\n  resumeId  String\n  resume    Resume @relation(fields: [resumeId], references: [id], onDelete: Cascade)\n  skillName String\n\n  @@id([resumeId, skillName])\n}\n\nmodel ResumeViewAudit {\n  id        BigInt       @id @default(autoincrement())\n  managerId BigInt\n  manager   ManagerToken @relation(fields: [managerId], references: [managerId])\n  resumeId  String\n  resume    Resume       @relation(fields: [resumeId], references: [id])\n  viewedAt  DateTime     @default(now())\n}\n\n// Search profiles for both vacancies and resumes\nmodel SearchProfile {\n  id           String    @id @default(uuid())\n  name         String\n  entityType   String // \"vacancy\" or \"resume\"\n  params       Json // HH API query parameters\n  enabled      Boolean   @default(true)\n  scheduleCron String    @default(\"30 2 * * *\") // Default: 02:30 daily\n  lastRun      DateTime?\n  createdAt    DateTime  @default(now())\n  updatedAt    DateTime  @updatedAt\n}\n",
